import React, { Component } from "react"
import TodoListItem from "./todoListItem"

export default class TodoList extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    const listLength = this.props.todoList.length
    return (
      <div>
        {listLength === 1
          ? `${listLength} thing to do`
          : `${listLength} things to do`}
        <ol>
          {this.props.todoList.map(todoItem => (
            <TodoListItem key={todoItem.id} todoItem={todoItem.name} />
          ))}
        </ol>
      </div>
    )
  }
}
